(defn encode-features
  [matchup]
  (let [[year round hi lo hiteam loteam hiseed loseed winner] matchup]
    [hiseed loseed winner]))

(def alpha 0.01)
(def iters 100)
(def model (regression-fit (make-logistic-regression alpha iters) (map encode-features training-set)))

(model :parameters)
